import "./App.css";
import Footer from "./components/Nav-Foot-Components/Footer";
import Navbar from "./components/Nav-Foot-Components/Navbar";
import { BrowserRouter as Router } from "react-router-dom";
import Routing from "./Config/Routing";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routing />
        <Footer />
      </Router>
    </div>
  );
}

export default App;
